// components/NavBar.tsx

import React, { useState } from "react";

export default function NavBar() {
  const [hover, setHover] = useState(false);

  return (
    <nav
      style={{
        maxWidth: '1440px',
        margin: '0 auto',
        height: '77px',
        background: '#FFFFFF',
        display: 'flex',
        alignItems: 'center',
        padding: '0 35px',
        boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)'
      }}
    >
      <div
        style={{
          fontFamily: 'Inter',
          fontStyle: 'italic',
          fontWeight: 900,
          fontSize: 32,
          lineHeight: '39px',
          color: '#000'
        }}
      >
        Service Name
      </div>

      <div
        style={{
          display: 'flex',
          gap: 32,
          marginLeft: 100,
          flexGrow: 1,
          justifyContent: 'center',
          position: 'relative'
        }}
      >
        <a style={{ fontWeight: 700, fontSize: 16, color: '#5B5B5B' }}>작품 질의하기</a>
        <a style={{ fontWeight: 700, fontSize: 16, color: '#5B5B5B' }}>하이라이트 제작</a>
        <a style={{ fontWeight: 700, fontSize: 16, color: '#5B5B5B' }}>웹툰 상세 분석</a>

        {/* 드롭다운 포함 영역 */}
        <div
          style={{ position: 'relative' }}
          onMouseEnter={() => setHover(true)}
          onMouseLeave={() => setHover(false)}
        >
          <a style={{ fontWeight: 800, fontSize: 16, color: '#09AA5C', paddingBottom: 4 }}>
            광고 초안 생성
          </a>

          {hover && (
            <div
              style={{
                position: 'absolute',
                top: 34,
                left: -15,
                background: '#fff',
                boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)',
                borderRadius: 3,
                padding: 8,
                width: 160,
                zIndex: 10
              }}
            >
              <div
                style={{
                  fontSize: 12,
                  fontWeight: 700,
                  color: '#09AA5C',
                  whiteSpace: 'nowrap'
                }}
              >
                웹툰 캐릭터 PPL
              </div>
              <div
                style={{
                  fontSize: 12,
                  fontWeight: 700,
                  color: '#5B5B5B',
                  marginTop: 8,
                  whiteSpace: 'nowrap'
                }}
              >
                웹툰 캐릭터 굿즈
              </div>
            </div>
          )}
        </div>

        <a style={{ fontWeight: 700, fontSize: 16, color: '#5B5B5B' }}>광고 파트너십 문의</a>
      </div>

      <div
        style={{
          fontFamily: 'Inter',
          fontStyle: 'italic',
          fontWeight: 700,
          fontSize: 20,
          marginRight: 20
        }}
      >
        Sign Up
      </div>
      <div
        style={{
          fontFamily: 'Inter',
          fontStyle: 'italic',
          fontWeight: 700,
          fontSize: 20,
          marginRight: 20
        }}
      >
        Sign In
      </div>
      <div
        style={{
          fontFamily: 'Inter',
          fontStyle: 'italic',
          fontWeight: 700,
          fontSize: 20,
          color: '#737373'
        }}
      >
        FAQ
      </div>
    </nav>
  );
}
